e) component of the color object in the HSB color space, specified as a value from 0.0 to 1.0.</param>		/// <param name="alpha">The opacity value of the color object, specified as a value from 0.0 to 1.0.</param>		/// <returns>An initialized color object. The color information represented by this object is in the device RGB colorspace.</returns>		[iOSVersion(2)]		public UIColor(CGFloat hue, CGFloat saturation, CGFloat brightness, CGFloat alpha) { }				/// <summary>		/// Initializes and returns a color object using the specified opacity and RGB component values.		/// </summary>		/// <param name="red">The red component of the color object, specified as a value from 0.0 to 1.0.</param>		/// <param name="green">The green component of the color object, specified as a value from 0.0 to 1.0.</param>		/// <param name="blue">The blue component of the color object, specified as a value from 0.0 to 1.0.</param>		/// <param name="alpha">The opacity value of the color object, specified as a value from 0.0 to 1.0.</param>		/// <returns>An initialized color object. The color information represented by this object is in the device RGB colorspace.</returns>		[iOSVersion(2)]		public UIColor(CGFloat red, CGFloat green, CGFloat blue, CGFloat alpha) { }				/// <summary>		/// Initializes and returns a color object using the specified Quartz color reference.		/// </summary>		/// <param name="CGColor">A reference to a Quartz color.</param>		/// <returns>An initialized color object. The color information represented by this object is in the native colorspace of the specified Quartz color.</returns>		[iOSVersion(2)]		public UIColor(CGColor CGColor) { }				/// <summary>		/// Initializes and returns a color object using the specified Quartz color reference.		/// </summary>		/// <param name="patternImage">The image to use when creating the pattern color.</param>		/// <returns>The pattern color.</returns>		[iOSVersion(2)]		public UIColor(UIImage patternImage) { }	