d whose alpha value is 1.0.		/// </summary>		/// <returns>The UIColor object.</returns>		[iOSVersion(2)]		[Export("greenColor")]		public static UIColor GreenColor() { return null; }				/// <summary>		/// Returns a color object whose RGB values are 0.0, 0.0, and 1.0 and whose alpha value is 1.0.		/// </summary>		/// <returns>The UIColor object.</returns>		[iOSVersion(2)]		[Export("blueColor")]		public static UIColor BlueColor() { return null; }				/// <summary>		/// Returns a color object whose RGB values are 0.0, 1.0, and 1.0 and whose alpha value is 1.0.		/// </summary>		/// <returns>The UIColor object.</returns>		[iOSVersion(2)]		[Export("cyanColor")]		public static UIColor CyanColor() { return null; }				/// <summary>		/// Returns a color object whose RGB values are 1.0, 1.0, and 0.0 and whose alpha value is 1.0.		/// </summary>		/// <returns>The UIColor object.</returns>		[iOSVersion(2)]		[Export("yellowColor")]		public static UIColor YellowColor() { return null; }				/// <summary>		/// Returns a color object whose RGB values are 1.0, 0.0, and 1.0 and whose alpha value is 1.0.		/// </summary>		/// <returns>The UIColor object.</returns>		[iOSVersion(2)]		[Export("magentaColor")]		public static UIColor MagentaColor() { return null; }				/// <summary>		/// Returns a color object whose RGB values are 1.0, 0.5, and 0.0 and whose alpha value is 1.0.		/// </summary>		/// <returns>The UIColor object.</returns>		[iOSVersion(2)]		[Export("orangeColor")]		public static UIColor OrangeColor() { return null; }				/// <summary>		/// Returns a color object whose RGB values are 0.5, 0.0, and 0.5 and whose alpha value is 1.0.		/// </summary>		/// <returns>The UIColor object.</returns>		[iOSVersion(2)]		[Export("purpleColor")]		public static UIColor PurpleColor() { return null; }				/// <summary>		/// Returns a color object whose RGB values are 0.6, 0.4, and 0.2 and whose alpha value is 1.0.		/// </summary>		/// <returns>The UIColor object.</returns>		[iOSVersion(2)]		[Export("brownColor")]		public static UIColor BrownColor() { return null; }				/// <summary>		/// Returns a color object whose grayscale and alpha values are both 0.0.		/// </summary>		/// <returns>The UIColor object.</returns>		[iOSVersion(2)]		[Export("clearColor")]		public static UIColor ClearColor() { return null; }				/// <summary>		/// Returns the system color used for displaying text on a dark background.		/// </summary>		/// <returns>The UIColor object.</returns>		[iOSVersion(2)]		[Export("lightTextColor")]		public static UIColor LightTextColor() { return null; }				/// <summary>		/// Returns the system color used for displaying text on a light background.		/// </summary>		/// <returns>The UIColor object.</returns>		[iOSVersion(2)]		[Export("darkTextColor")]		public static UIColor DarkTextColor() { return null; }				/// <summary>		/// Returns the system color used for the background of a grouped table.		/// </summary>		/// <returns>The UIColor object.</returns>		[iOSVersion(2)]		[Export("groupTableViewBackgroundColor")]		public static UIColor GroupTableViewBackgroundColor() { return null; }				/// <summary>		/// Returns the system color used for the back side of a view while it is being flipped.		/// </summary>		/// <returns>The UIColor object.</returns>		[iOSVersion(2)]		[Export("viewFlipsideBackgroundColor")]		public static UIColor ViewFlipsideBackgroundColor() { return null; }				/// <summary>		/// Returns the system pattern color used to render the area behind scrollable content.		/// </summary>		/// <returns>The UIColor object.</returns>		[iOSVersion(3.2)]		[Export("scrollViewTexturedBackgroundColor")]		public static UIColor ScrollViewTexturedBackgroundColor() { return null; }				/// <summary>		/// Returns the system pattern color used to render the background of a page.		/// </summary>		/// <returns>The UIColor object.</returns>		[iOSVersion(5)]		[Export("underPageBackgroundColor")]		public static UIColor UnderPageBackgroundColor() { return null; }				/// <summary>		/// The Quartz color reference that corresponds to the receiverâ€™s color. (read-only)		/// </summary>		[iOSVersion(2)]		[Export("CGColor")]		public CGColor CGColor { get; private set; }				/// <summary>		/// The Core Image color associated with the receiver. (read-only)		/// </summary>		[iOSVersion(5)]		[Export("CIColor")]		public CIColor CIColor { get; private set; }				/// <summary>		/// Returns the components that make up the color in the HSB color space.		/// </summary>		/// <param name="hue">On return, the hue component of the color object, specified as a value between 0.0 and 1.0.</param>		/// <param name="saturation">On return, the saturation component of the color object, specified as a value between 0.0 and 1.0.</param>		/// <param name="brightness">On return, the brightness component of the color object, specified as a value between 0.0 and 1.0.</param>		/// <param name="alpha">On return, the opacity component of the color object, specified as a value between 0.0 and 1.0.</param>		/// <returns>true if the color could be converted, false otherwise.</returns>		[iOSVersion(5)]		[Export("getHue")]		public bool GetHue(CMutablePointer<CGFloat> hue, CMutablePointer<CGFloat> saturation, CMutablePointer<CGFloat> brightness, CMutablePointer<CGFloat> alpha) { return false; }				/// <summary>		/// Returns the components that make up the color in the RGB color space.		/// </summary>		/// <param name="red">On return, the red component of the color object, specified as a value between 0.0 and 1.0.</param>		/// <param name="green">On return, the green component of the color object, specified as a value between 0.0 and 1.0.</param>		/// <param name="blue">On return, the blue component of the color object, specified as a value between 0.0 and 1.0.</param>		/// <param name="alpha">On return, the opacity component of the color object, specified as a value between 0.0 and 1.0.</param>		/// <returns>true if the color could be converted, false otherwise.</returns>		[iOSVersion(5)]		[Export("getRed")]		public bool GetRed(CMutablePointer<CGFloat> red, CMutablePointer<CGFloat> green, CMutablePointer<CGFloat> blue, CMutablePointer<CGFloat> alpha) { return false; }				/// <summary>		/// Returns the grayscale components of the color.		/// </summary>		/// <param name="white">On return, the grayscale component of the color object, specified as a value between 0.0 and 1.0.</param>		/// <param name="alpha">On return, the opacity component of the color object, specified as a value between 0.0 and 1.0.</param>		/// <returns>true if the color could be converted, false otherwise.</returns>		[iOSVersion(5)]		[Export("getWhite")]		public bool GetWhite(CMutablePointer<CGFloat> white, CMutablePointer<CGFloat> alpha) { return false; }				/// <summary>		/// Sets the color of subsequent stroke and fill operations to the color that the receiver represents.		/// </summary>		[iOSVersion(2)]		[Export("set")]		public void Set() { }				/// <summary>		/// Sets the color of subsequent fill operations to the color that the receiver represents.		/// </summary>		[iOSVersion(2)]		[Export("setFill")]		public void SetFill() { }				/// <summary>		/// Sets the color of subsequent stroke operations to the color that the receiver represents.		/// </summary>		[iOSVersion(2)]		[Export("setStroke")]		public void SetStroke() { }	}}